function TrainsPanel(props) 
{
    const handleTrainClick = (train) =>
    {
      console.log("hey!")
    };

    return (
      <>
        {props.TrainManager.trains.map((train, index) =>(
          <button key={index} onClick={() => handleTrainClick(train)}>
            {train.name}
          </button>
        ))}
      </>
    );
}

  
export default TrainsPanel;
